query BlogPostbyPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    html
    frontmatter {
      path
      title
      date
    }
  }
}

query BlogIndexQuery {
  allMarkdownRemark {
    edges {
      node {
        id
        frontmatter {
          path
          title
          date
        }
        excerpt
      }
    }
  }
}
